import Card from '~/components/Card.vue'
import projs from '@/content/projs.json'

export default {
    metaInfo: {
        title: 'test'
    },
    components: {
        Card
    },
    data () {
        return {
            projs
        }
    },
    computed: {
        currentProj () {
            return this.projs
            .filter((projs) => {
                return projs.status.match("in progress")
            })
        },
        completedProj () {
            return this.projs
            .filter((projs) => {
                return projs.status.match("complete")
            })
        }
    }
}
